import React from 'react';
import pixChat from '../../assets/pixchat.svg';

const pixChatSVG = () => (
  <div className="PiXChatSVG-Component">
    <img src={pixChat} className="pixchaticon" id="caret" alt="caret-here" />
  </div>
);

export default pixChatSVG;
